  <script type="text/javascript">
    $(document).ready(function () {
      var language = 'en-US';
    });

    var afterView = new QueueIt.Queue.AfterView({
      customerId: 'frontenddevelopers',
      eventId: 'fed2021',
      queueId: '00000000-0000-0000-0000-000000000001',
      language: 'en-US',
      layoutName: '',
      tags: []
    });

    var queueViewModel = afterView;
    $(document).ready(function () {
      ko.applyBindings(afterView, $('#language-selector').get(0));
      ko.applyBindings(afterView, $('#MainPart_divTimeBox').get(0));
      //window.afterView.onReady("after");
      window.queueViewModel.onReady("after");

<body data-pageid="after" data-culture="en-US" class="after">
  <div id="toppanel" data-bind="visible: layout.topPanelVisible">
    <iframe id='toppanel_iframe' src='files/top.html' allowtransparency='true' frameborder='0' scrolling='no'></iframe>
  </div>

  <div id="wrapper">
    <div id="leftpanel" data-bind="visible: layout.leftPanelVisible">
      <iframe id='leftpanel_iframe' src='' allowtransparency='true' frameborder='0' scrolling='no'></iframe>
    </div>

    <div id="main">
      <div id="main-top">
        <div id="language-selector" title="select display language" style="display: none;"
          data-bind="visible: languageSelector.languages().length > 1 && languageSelector.languageSelectorVisible">
          <select id="SharedTexts_Languages_SelectedValue"
            data-bind="options: languageSelector.languages, optionsText:'text', optionsValue:'value', value:languageSelector.selectedLanguage "></select>
        </div>
        <div id="main-top-message">
          <p class="item">
            <span id="lbCookieInfo"
              data-bind="text: texts.cookiesInfoText, attr: { class: texts.cookiesInfoClass, title: texts.cookiesInfoTooltip }"></span>
          </p>
        </div>
      </div>

      <div id="main_t" class="t"></div>
      <div id="main_c" class="c">
        <div id="content">
          <div id="header">
            <h1 class="logo" data-bind="visible: layout.logoVisible">
              <img src="files/default_images/queue-it_logo.png" id="imgCustomerLogo" alt="logo"
                longdesc="company logo for Queue-it" data-bind="attr:  { src: texts.logoSrc }" />
            </h1>
            <h2>
              <span id="lbHeaderH2" data-bind="html: texts.header">The event has ended</span>
            </h2>
            <div id="headerparagraph">
              <span id="lbHeaderP" data-bind="html: texts.body">The FED 2021 event has ended, and the line is now
                closed.</span>
            </div>
            <div id="whatisthis">
              <a id="hlThisIsQueueIt"
                href="https://queue-it.com/what-is-this.html?customerId=frontenddevelopers&amp;eventId=fed2021&amp;queueId=00000000-0000-0000-0000-000000000000&amp;language=en-US&amp;preview=true"
                target="_blank" data-bind="attr: { href: texts.whatIsThisUrl }">What is this?</a>
            </div>
          </div>

          <div id="MainPart_divWarningBox" class="warning-box"></div>
          <div id="MainPart_divProcessbarBox" class="processbar-box">
            <div id="MainPart_divProcessbarBox_Holder" class="holder">
              <p class="larger">
                <span id="MainPart_lbInfo"></span>
              </p>
            </div>
          </div>
          <div id="MainPart_divBlock" class="block">
            <p></p>
          </div>
          <div id="MainPart_divTimeBox" class="time-box" data-bind="visible: message()">
            <!-- <div id="MainPart_divTimeBox_Holder" class="holder" data-bind="if: message()">
        <div id="MainPart_divTimeBox_Holder_Frame" class="frame">
            <h2>
                <span id="MainPart_h2MessageOnQueueTicket" data-bind="text: message().header">Message last updated:</span>
                <span id="MainPart_h2MessageOnQueueTicketTimeText" data-bind="text: message().timestampFormatted">10:34 AM</span>
                <span id="MainPart_h2MessageOnQueueTicketTimeTextTimeZonePostfix" data-bind="text: message().timeZonePostfix"></span>
            </h2>
            <p id="MainPart_pMessageOnQueueTicket" data-bind="creoleText: message().text">This is a test message.</p>
        </div>
    </div> -->
          </div>

        </div>
        <div id="middlepanel" style="display: none;" data-bind="visible: layout.middlePanelVisible">
          <iframe id='middlepanel_iframe' src='' allowtransparency='true' frameborder='0' scrolling='no'
            data-bind="iframe-src-attr: { src: texts.middlepanelIFrameSrc }"></iframe>
        </div>

        <div id="footer">
          <div id="footer-disclaimer" data-bind="html: texts.disclaimerText"></div>

          <div id="footer-direct-link" style="" data-bind="visible: hasQueueId"><span

          <div id="footer-queueit-link">
            <strong class="by">
              <a href="https://queue-it.com/what-is-this.html?customerId=frontenddevelopers&amp;eventId=fed2021&amp;queueId=00000000-0000-0000-0000-000000000000&amp;language=en-US&amp;preview=true"
                id="aThisIsQueueIt" target="_blank">QUEUE-IT</a>
            </strong>
          </div>
        </div>

      <div id="MainPart_divVersionInfo" class="b" title="4.4.197.0"></div>
